      import subprocess

      try:
          result = subprocess.run(
              ["./temp_executable AAAA"],
              capture_output=True,
              encoding="utf-8",
              errors="replace",
              shell=True,
              timeout=timeout,
          )
          # Return stderr and the return code
          return result.stderr, result.returncode
